import React from 'react';
import { useTheme } from '../hooks/useTheme';

const SubmissionPanel = ({ result, isDarkMode, onClose }) => {
  const { colors } = useTheme(isDarkMode);

  if (!result) return null;

  const isAccepted = result.submissionStatus === 'Accepted';
  const failedTestCase = !isAccepted && result.testResults ? 
    result.testResults.findIndex(test => !test.passed) + 1 : 
    null;

  return (
    <div className="h-full flex flex-col" style={{ backgroundColor: colors.background.secondary }}>
      {/* Header */}
      <div className="flex items-center justify-between p-3" style={{ 
        backgroundColor: colors.background.primary,
        borderBottom: `1px solid ${colors.border.primary}`
      }}>
        <h2 className="text-sm font-medium" style={{ color: colors.text.primary }}>
          Submission Result
        </h2>
        <button
          onClick={onClose}
          className="p-1 rounded hover:bg-opacity-80"
          style={{ color: colors.text.secondary }}
        >
          ✕
        </button>
      </div>

      {/* Content */}
      <div className="flex-1 overflow-y-auto">
        {result.error ? (
          <div className="p-4">
            <div className="p-3 rounded" style={{ 
              backgroundColor: colors.status.error.background,
              color: colors.status.error.text 
            }}>
              <div className="font-semibold">Error:</div>
              <div className="whitespace-pre-wrap">{result.error}</div>
              {result.details && (
                <div className="mt-2 text-sm opacity-75 whitespace-pre-wrap">
                  {result.details}
                </div>
              )}
            </div>
          </div>
        ) : (
          <div>
            {/* Status Banner */}
            <div className="p-4" style={{
              backgroundColor: isAccepted ? colors.status.success.background : colors.status.error.background,
              color: isAccepted ? colors.status.success.text : colors.status.error.text
            }}>
              {isAccepted ? (
                <div className="text-center">
                  <div className="text-xl font-medium mb-1">All Test Cases Passed!</div>
                  <div className="text-sm opacity-90">
                    Your solution beat {Math.floor(Math.random() * 30 + 70)}% of submissions
                  </div>
                </div>
              ) : (
                <div className="text-center">
                  <div className="text-xl font-medium mb-1">Wrong Answer</div>
                  <div className="text-sm opacity-90">
                    Test Case {failedTestCase} Failed
                  </div>
                </div>
              )}
            </div>

            {/* Failed Test Case Details */}
            {!isAccepted && failedTestCase && result.testResults && (
              <div className="p-4 space-y-4">
                <div>
                  <div className="text-sm font-medium mb-2" style={{ color: colors.text.secondary }}>
                    Input
                  </div>
                  <div className="p-3 rounded font-mono text-sm" style={{ 
                    backgroundColor: colors.background.primary,
                    color: colors.text.primary
                  }}>
                    {result.testResults[failedTestCase - 1].input}
                  </div>
                </div>

                <div>
                  <div className="text-sm font-medium mb-2" style={{ color: colors.text.secondary }}>
                    Your Output
                  </div>
                  <div className="p-3 rounded font-mono text-sm" style={{ 
                    backgroundColor: colors.background.primary,
                    color: colors.text.primary
                  }}>
                    {result.testResults[failedTestCase - 1].actualOutput}
                  </div>
                </div>

                <div>
                  <div className="text-sm font-medium mb-2" style={{ color: colors.text.secondary }}>
                    Expected Output
                  </div>
                  <div className="p-3 rounded font-mono text-sm" style={{ 
                    backgroundColor: colors.background.primary,
                    color: colors.text.primary
                  }}>
                    {result.testResults[failedTestCase - 1].expectedOutput}
                  </div>
                </div>
              </div>
            )}
          </div>
        )}
      </div>
    </div>
  );
};

export default SubmissionPanel;
